1) Os documentos a serem apresentados, em envelope próprio, no ato da matrícula são: 
a) Carteira de Identidade - RG (original e cópia simples legível). A carteira nacional de habilitação (CNH), para fins de matrícula, não substitui o RG. 
b) Certidão de Nascimento ou de casamento (original e cópia simples legível); 
c) Número do CPF, caso o número não conste no RG;
d) Certificado/Certidão de Conclusão contendo data da confecção do Histórico Escolar OU Histórico Escolar do Ensino Médio, de acordo com os requisitos para ingresso descritos no item 2. deste Edital (original e cópia simples legível).
e) Comprovante de residência (original e cópia simples legível); 
f) Comprovante de quitação com o Serviço Militar, para candidato(a)s do sexo masculino com idade superior a 18 anos (original e cópia simples legível); 
g) Número do Título de Eleitor para maiores de 18 anos; 
h) 01 fotografia recente 3x4; 
2) Certidão de quitação eleitoral atualizada será obtida pela secretaria de cada Campus, mediante consulta on-line à base de dados da administração, conforme disposto na Portaria Ministerial nº 176, de 25 de junho de 2018. Atinente a certidão de quitação eleitoral, havendo inconsistência cadastral nos dados do participante, de forma a impedir a obtenção do documento através de consulta on-line ao banco de dados da administração, deverá a secretaria do campus solicitar ao candidato(a) sua apresentação. Caso a impossibilidade de sua obtenção pela secretaria se dê em razão da indisponibilidade de consulta on-line à base de dados oficial, a comprovação necessária poderá ser feita por meio de declaração escrita e assinada pelo candidato(a), que na hipótese de declaração inverídica ficará sujeito às sanções administrativas, civis e penais aplicáveis. (Documentação conforme Lei 13.726/2018, Portaria Interministerial 176 de 25 de junho de 2018 e Decreto 9.094/17).
3) Cada campus poderá solicitar documentos complementares, os quais serão especificados no edital de matrículas. Nesses casos, a ausência desses documentos não poderá ser impeditivo para a realização da matrícula.

2.ds_documentacao:
Ampla concorrência

a)	Requerimento de Solicitação de Matrícula e Declaração: impressos via Portal PROGRAD, após a conclusão da etapa de Solicitação de Matrícula;
b)	Certidão do Registro Civil: uma fotocópia legível (nascimento ou casamento);
c)	Cédula de Identidade: uma fotocópia legível;
d)	CPF: uma fotocópia legível;
e)	Título de Eleitor e comprovante de quitação eleitoral: uma fotocópia legível, para maiores de 18 (dezoito) anos;
f)	Documento Militar: uma fotocópia legível, para maiores de 18 (dezoito) anos do sexo masculino;
g)	Histórico Escolar do Ensino Médio: duas fotocópias legíveis;
h)	Certificado de Conclusão do Ensino Médio: duas fotocópias legíveis (caso esse documento não esteja integrado ao Histórico Escolar do Ensino Médio);
i)	Diploma de Curso Profissionalizante: duas fotocópias legíveis, para o candidato aprovado que tiver feito o Ensino Médio profissionalizante (nesse caso, o histórico escolar do ensino médio deverá conter as disciplinas obrigatórias do núcleo comum de acordo com a LDB vigente à época da conclusão, e as disciplinas específicas do curso técnico);
j)	Diploma de Curso de Graduação devidamente registrado: duas fotocópias legíveis, caso o candidato já seja graduado; neste caso, é dispensada aos candidatos da Modalidade de Ampla Concorrência, a apresentação dos documentos indicados nos itens g, h e i;
k)	Parecer de Equivalência de estudos emitido pela Secretaria de Estado da Educação: duas fotocópias legíveis, para o candidato aprovado que tenha concluído estudos equivalentes ao Ensino Médio no exterior;
l)	Documentos em língua estrangeira comprobatórios da conclusão de estudos equivalentes ao Ensino Médio ou Ensino Superior no Exterior: duas fotocópias legíveis. Estes documentos devem estar visados pela autoridade consular brasileira no país de origem e acompanhados da respectiva tradução oficial.

Vagas reservadas

a)	Requerimento de Solicitação de Matrícula e Declaração: impressos via Portal PROGRAD, após a conclusão da etapa de Solicitação de Matrícula;
b)	Certidão do Registro Civil: uma fotocópia legível (nascimento ou casamento);
c)	Cédula de Identidade: uma fotocópia legível;
d)	CPF: uma fotocópia legível;
e)	Título de Eleitor e comprovante de quitação eleitoral: uma fotocópia legível, para maiores de 18 (dezoito) anos;
f)	Documento Militar: uma fotocópia legível, para maiores de 18 (dezoito) anos do sexo masculino;
g)	Histórico Escolar do Ensino Médio: duas fotocópias legíveis;
h)	Certificado de Conclusão do Ensino Médio: duas fotocópias legíveis (caso esse documento não esteja integrado ao Histórico Escolar do Ensino Médio);
i)	Diploma de Curso Profissionalizante: duas fotocópias legíveis, para o candidato aprovado que tiver feito o Ensino Médio profissionalizante (nesse caso, o histórico escolar do ensino médio deverá conter as disciplinas obrigatórias do núcleo comum de acordo com a LDB vigente à época da conclusão, e as disciplinas específicas do curso técnico);
j)	Diploma de Curso de Graduação devidamente registrado: duas fotocópias legíveis, caso o candidato já seja graduado; (neste caso, não é dispensada a apresentação do ensino médio);
k)	Parecer de Equivalência de estudos emitido pela Secretaria de Estado da Educação: duas fotocópias legíveis, para o candidato aprovado que tenha concluído estudos equivalentes ao Ensino Médio no exterior;
l)	Documentos em língua estrangeira comprobatórios da conclusão de estudos equivalentes ao Ensino Médio ou Ensino Superior no Exterior: duas fotocópias legíveis. Estes documentos devem estar visados pela autoridade consular brasileira no país de origem e acompanhados da respectiva tradução oficial. 

O participante deverá atentar para o preenchimento do Requerimento de Solicitação de Homologação de Cotas e documentação descrita nos Editais Complementares.

3.ds_documentacao:
Cópia e original (ou cópia autenticada) do Certificado de Conclusão do Ensino Médio, com o respectivo Histórico Escolar;
Cópia legível da Certidão de Nascimento ou de Casamento;
Cópia legível do Documento de Identidade, Carteira de Identidade;
Uma fotografia 3x4 recente;
Cópia legível do CPF ou do comprovante de cadastro emitido pela Receita Federal;
Cópia legível do Título de Eleitor e do comprovante de quitação com a Justiça Eleitoral ou comprovante de regularização junto ao Tribunal Superior Eleitoral. O comprovante poderá ser 
retirado no site do TSE, no endereço: www.tse.jus.br ou tse.jus.br/eleitor/serviços/certidoes/certidao-de-quitacao-eleitoral;
Cópia legível do comprovante de estar em dia com o Serviço Militar (sexo masculino); 
Cópia legível do Cartão de Vacinas atualizado.
No caso de estrangeiros, apresentar passaporte com visto permanente ou passaporte e autorização da Diretoria de Relações Internacionais da UFV (DRI), comprovando, além a legalidade de sua permanência no Brasil, a autorização para se matricular no curso pretendido na UFV. 
Os ingressantes que tenham concluído Ensino Médio em instituições estrangeiras deverão apresentar toda a documentação exigida para a matrícula autenticada em Representação Consular Brasileira, no país onde funciona o estabelecimento de ensino que a houver expedido, e oficialmente traduzida para a língua portuguesa.

4.ds_documentacao:
Na data da matrícula, o candidato ou o seu procurador legal deverá apresentar-se no local e horário indicados na página da UFRRJ (http://portal.ufrrj.br/). Estas informações serão divulgadas simultaneamente ao resultado final do Sistema de Seleção Unificada. Para realizar a matrícula, o candidato convocado deverá apresentar os seguintes documentos:
 - Documento de identificação civil oficial, com foto e válido (original e cópia);
 - Cadastro de Pessoa Física - CPF (original e cópia);
 - Histórico Escolar, com assinatura e carimbo legíveis do responsável e da instituição que expediu o documento (original e cópia);
 - Certificado de Conclusão ou Diploma de Ensino Médio, com assinatura e carimbo legíveis do responsável e da instituição que expediu o documento (original e cópia);
 - Documento militar: Certificado de Dispensa de Incorporação (CDI), Certificado de Reservista (CR), Carteira de Militar (ATIVO) ou, provisoriamente, o Certificado de Alistamento Militar (CAM), provando estar em dia com suas obrigações militares, somente candidatos do sexo masculino (original e cópia);
 - Título de eleitor (original e cópia);
 - Comprovante de votação na última eleição, para candidatos com 18 anos ou mais, podendo ser substituída pela Certidão de Quitação Eleitoral emitida pelo Tribunal Superior Eleitoral no site www.tse.jus.br. (original e cópia).
